/*AIzaSyBgTOPt0fvSuF2_4MAAIVc11haFAT_YpEo*/
import axios from "axios";

const KEY = "AIzaSyBgTOPt0fvSuF2_4MAAIVc11haFAT_YpEo";

export default axios.create({
    baseURL:'https://www.googleapis.com/youtube/v3',
    params:{
            part:'snippet',
            maxResults:5,
            key:KEY
    }
});
